const UserList= (props)=>{
    return(
        <table class="table table-bordered">
        <thead>
            {TblHeaders}
        </thead>
        <tbody>
            <tr>
                <td>John</td>
                <td>Doe</td>
                <td>john@example.com</td>
            </tr>
        </tbody>
    </table>
    )
}

export default UserList;



const TblHeaders= <tr>
                    <th>Name</th>
                    <th>Lastname</th>
                    <th>Email</th>
                </tr>;
